sourcesContent:
function add(a, b) {
  let sum = a + b;
  return sum;
}

function sub(a, b) {
  let min = a - b;
  return min;
}

function div(a, b) {
  let division = a / b;
  return division;
}

function mul(a, b) {
  let multiply = a * b;
  return multiply;
}

export default add;
export { sub, div, mul };
